members.comment:
Returns an array containing all of the elements in this list in proper sequence (from first to last element); the runtime type of the returned array is that of the specified array. If the list fits in the specified array, it is returned therein. Otherwise, a new array is allocated with the runtime type of the specified array and the size of this list. If the list fits in the specified array with room to spare (i.e., the array has more elements than the list), the element in the array immediately following the end of the list is set to null. (This is useful in determining the length of the list only if the caller knows that the list does not contain any null elements.) Like the toArray() method, this method acts as bridge between array-based and collection-based APIs. Further, this method allows precise control over the runtime type of the output array, and may, under certain circumstances, be used to save allocation costs. Suppose x is a list known to contain only strings. The following code can be used to dump the list into a newly allocated array of String: 
     String[] y = x.toArray(new String[0]);
 Note that toArray(new Object[0]) is identical in function to toArray().

implSpec:
The default implementation is equivalent to, for this 
<code>list</code>: 
<pre><code>
     final ListIterator&lt;E&gt; li = list.listIterator();
     while (li.hasNext()) {
         li.set(operator.apply(li.next()));
     }
 </code></pre> If the list's list-iterator does not support the 
<code>set</code> operation then an 
<code>UnsupportedOperationException</code> will be thrown when replacing the first element.

members.comment:
Returns the hash code value for this list. The hash code of a list is defined to be the result of the following calculation: 
     int hashCode = 1;
     for (E e : list)
         hashCode = 31*hashCode + (e==null ? 0 : e.hashCode());
 This ensures that list1.equals(list2) implies that list1.hashCode()==list2.hashCode() for any two lists, list1 and list2, as required by the general contract of Object.hashCode().

Returns a view of the portion of this list between the specified fromIndex, inclusive, and toIndex, exclusive. (If fromIndex and toIndex are equal, the returned list is empty.) The returned list is backed by this list, so non-structural changes in the returned list are reflected in this list, and vice-versa. The returned list supports all of the optional list operations supported by this list. This method eliminates the need for explicit range operations (of the sort that commonly exist for arrays). Any operation that expects a list can be used as a range operation by passing a subList view instead of a whole list. For example, the following idiom removes a range of elements from a list: 
      list.subList(from, to).clear();
 Similar idioms may be constructed for indexOf and lastIndexOf, and all of the algorithms in the Collections class can be applied to a subList. The semantics of the list returned by this method become undefined if the backing list (i.e., this list) is structurally modified in any way other than via the returned list. (Structural modifications are those that change the size of this list, or otherwise perturb it in such a fashion that iterations in progress may yield incorrect results.)

apiNote:
This method also accepts a single array as an argument. The element type of the resulting list will be the component type of the array, and the size of the list will be equal to the length of the array. To create a list with a single element that is an array, do the following: 
<pre><code>
     String[] array = ... ;
     List&lt;String[]&gt; list = List.&lt;String[]&gt;of(array);
 </code></pre> This will cause the 
<a href="https://docs.oracle.com/en/java/javase/16/docs/api/java.base/java/util/List.html#of(E)"><code>List.of(E)</code></a> method to be invoked instead.
